import React, { Component } from "react";

export class Project extends Component {
  render() {
    let { name, languages, languagesIcons, source, info, picture } =
      this.props.item;

    return (
      <div className="project">
        <div className="icons">
          {languages.map((language) => {
            <h4>{language}</h4>;
          })}
        </div>
        <h3>{name}</h3>
      </div>
    );
  }
}

export default Project;
